import React from 'react';
import { connect } from 'react-redux';

const ImageMain = ({url}) => {
  console.log(url);
  return(
    <div>
        <img
          className="sample-img"
          src="https://cdn-images-1.medium.com/max/1000/1*PjLIvhVpVh26HXKyIc02lg.jpeg"
          alt="analyze main"
        />
    </div>
  );
};

const mapStateToProps = state => {
  return {
    url: state.url
  };
};

export default connect(mapStateToProps)(ImageMain);
